'mail/chrome/messenger/preferences/applications.dtd:authRequired.button.accesskey' => '',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term3' => 'Dịch Vụ được cung cấp theo &#34;nguyên trạng.&#34; &amp;vendorShortName;, những người đóng góp, các bên cung cấp giấy phép và các bên phân phối từ chối tất cả trách nhiệm, cho dù là rõ ràng hay mặc nhiên, bao gồm không giới hạn cả các trách nhiệm trong việc Dịch Vụ có thể được buôn bán và phù hợp mục đích đặc thù của bạn. Bạn tự chịu lấy toàn bộ nguy cơ khi chọn Dịch Vụ cho mục đích của mình cũng như về chất lượng và hiệu năng của Dịch Vụ. Một số luật xét xử không cho phép sự miễn trừ hoặc giới hạn đối với các trách nhiệm mặc nhiên, cho nên bản tuyên bố từ chối trách nhiệm này có thể không áp dụng đối với bạn.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term2' => 'Bạn được hoan nghênh trong việc sử dụng những Dịch Vụ này cùng với phiên bản kèm theo của &amp;brandShortName;, và bạn có tất cả các quyền cần thiết để làm vậy. &amp;vendorShortName; và các nhà cung cấp giấy phép của mình bảo lưu tất cả các quyền khác trong Dịch Vụ. Những điều khoản này không nhằm mục đích giới hạn bất kì quyền nào được trao theo giấy phép mã nguồn mở phù hợp với &amp;brandShortName; và phiên bản mã nguồn mở tương ứng của &amp;brandShortName;.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term5' => '&amp;vendorShortName; đôi khi có thể cập nhật các điều khoản này khi cần thiết. Các điều khoản này không được sửa đổi hoặc hủy bỏ nếu không có thỏa thuận viết tay của &amp;vendorShortName;.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term4' => 'Trừ khi được yêu cầu bởi luật pháp, &amp;vendorShortName;, những người đóng góp, các bên cung cấp giấy phép và phân phối sẽ không có nghĩa vụ đối với bất kì tổn hại gián tiếp, đặc biệt, vô tình, mang tính hậu quả, mang tính trừng phạt hoặc cảnh cáo nào xảy ra bên ngoài hoặc trong bất kì cách thức nào liên quan đến việc sử dụng &amp;brandShortName; và Dịch Vụ. Tổng các nghĩa vụ tập hợp trong các điều khoản này không vượt quá $500 (năm trăm đôla). Một số luật xét xử không cho phép sự miễn trừ hoặc giới hạn đối với những tổn hại nào đó, cho nên sự miễn trừ và giới hạn này có thể không áp dụng đối với bạn.',
