'mail/chrome/messenger/messengercompose/composeMsgs.properties:12590' => 'Thư không thể gửi được vì kết nối tới máy chủ SMTP %S bị thất bại. Máy chủ không hiện hữu hoặc đang từ chối kết nối SMTP. Vui lòng kiểm tra thiết lập máy chủ SMTP của bạn xem đã đúng chưa rồi thử lại, hoặc liên hệ nhà quản trị máy chủ.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12591' => 'Thư không thể gửi được vì kết nối tới máy chủ SMTP %S bị mất tín hiệu trong quá trình truyền tải. Hãy thử lại, hoặc liên hệ nhà quản trị máy chủ.',
