'mail/chrome/messenger/messengercompose/composeMsgs.properties:12594' => 'Máy chủ SMTP %S có vẻ không hỗ trợ mật khẩu mã hóa. Nếu bạn chỉ thiết lập tài khoản, vui lòng thử thay đổi thành &#39;Mật khẩu, truyền không an toàn&#39; trong &#39;Phương thức xác thực&#39; của &#39;Thiết lập Tài khoản | Thiết lập Máy chủ&#39;. Nếu nó từng hoạt động và tự nhiên bây giờ bị thất bại, đây là một tình huống thông thường của việc một ai đó có thể đã ăn cắp mật khẩu của bạn.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12595' => 'Máy chủ SMTP %S có vẻ không hỗ trợ mật khẩu mã hóa. Nếu bạn chỉ thiết lập tài khoản này, vui lòng thử thay đổi thành &#39;Mật khẩu bình thường&#39; trong &#39;Phương thức xác thực&#39; của &#39;Thiết lập Tài khoản | Thiết lập Máy chủ&#39;. Nếu nó từng hoạt động và tự nhiên bây giờ bị thất bại, vui lòng liên hệ nhà cung cấp hoặc nhà quản trị email của bạn.',
